import React from "react";
import { Button, Modal } from "semantic-ui-react";

class Submitted extends React.Component {
  state = {
    submit: "Submit",
  };
  closeWindow = (event) => {
    event.preventDefault();
    window.location.reload(true);
  };

  onSubmitGame = (event) => {
    event.preventDefault();
    console.log(game);
    this.props.createProject(game);
    this.setState({ submit: "Submitted !" });
    //history.push("/dashboard");
    //window.location.reload(true);
  };

  render() {
    return (
      <Modal
        size="mini"
        trigger={
          <Button
            size="medium"
            style={{
              marginTop: 12,
              fontSize: 13,
              marginLeft: 10,
              backgroundColor: "#2A9D8F",
              color: "white",
            }}
            onClick={this.onSubmitGame}
          >
            <i className="users icon"></i>
            {this.state.submit}
          </Button>
        }
      >
        <Modal.Content>
          <p>Your Game has been created successfully!</p>
        </Modal.Content>
        <Modal.Actions>
          <Button positive onClick={this.closeWindow}>
            Done
          </Button>
        </Modal.Actions>
      </Modal>
    );
  }
}

export default Submitted;
